import React from "react";
import "./card.css"

const Card = ({pokemon}) => {
    return(
        <div className="Container">
            <div className="Card">
                <div className="Card-img">
                        {/*<img src={pokemon.sprites.front_default} alt="" />*/}
                        <img className="img" src={`https://pokeres.bastionbot.org/images/pokemon/${pokemon.id}.png`} alt="" />
                </div>
                <div className="Card-name">
                    {pokemon.name}
                </div>
                <div className="Card-types">
                    {pokemon.types.map(type => {
                        return(
                            <div className="Card-type">
                                {type.type.name}
                            </div>
                        )
                    })}
                </div>
                <div className="Card-info">
                    <div className="Card-data Card-data-weight">
                        <p className="title"> weight </p>
                        <p>{pokemon.weight}</p>
                    </div>
                    <div className="Card-data Card-data-height">
                        <p className="title"> height </p>
                        <p>{pokemon.height}</p>
                    </div>
                    <div className="Card-data Card-data-ability">
                        <p className="title"> ability</p>
                        <p>{pokemon.abilities[0].ability.name}</p>
                    </div>
                </div>
            </div>
        </div>
    )

}

export default Card;
